  {
    path: "/",
    element: <div>Home!</div>,
  },
  {
    path: "/register",
    element: <Register />,
  },
  {
    path: "/",
    element: <div>Home!</div>,
  },
  {
    path: "/",
    element: <div>Home!</div>,
  },

]);

